import { useState, useEffect } from "react";
import axios from "axios";

function ShowAllAds(props) {
  const [ads, setAds] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:3001/api")
      .then((res) => {
        setAds(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  console.log(ads.message);

  return (
    <>
      <div>{!data ? "Loading..." : <div className="page">{listAds}</div>}</div>
      <a href="/screen=0"> Back to Admin Page</a>
      <button
        onClick={() => {
          fetch("/api")
            .then((res) => res.json())
            .then((data) => setData(data.message));
        }}
      >
        pull ads
      </button>
    </>
  );
}

export default ShowAllAds;
